import React from 'react';

export const Post = (props) => {
    const loadPosts = props.loadPosts;
    const listItems = loadPosts.allPosts.map((postData) =>
        <li key={postData.id}>{postData.title}</li>
    );
    return (
        <ul>{listItems}</ul>
    );
}
